import NavbarSettings from "./navbar_settings"
import axios from 'axios'
export default function Accounts(){

  const [data,setData] = useState([])
  async function  fetchdata() {
    try {
      const res= await axios.get('http://localhost:8080/accounts/')
      console.log(res)
      return res.data

    } catch (error) {
      console.log(error)
    }
  }
  useEffect(()=> {
    fetchdata()
      .then(datas =>setData(datas))
  },[])
  const num= data[0].acc_num
  const name=data[0].acc_name
  const type=data[0].acc_type
  const balance=data[0].acc_balance
  return(
    <div className="acc">
      <div>
        <h3>Settings</h3>
        <NavbarSettings />
      </div>
      <div className="acc-intro">
        <h4>Account Number</h4>
        {num}
        <h4>Account Name</h4>
        <h4>Account Type</h4>
        <h4>Account Balance</h4>

      </div>
    </div>

  )
}
